import React from 'react'
import './Footer.css'
const Footer = () =>{
	return(
		<footer className="footer">
        
        <pre>
          सिमरउ सिमरि सिमरि सुखु पावउ ॥<br /> कलि कलेस तन माहि मिटावउ ॥
        </pre>
      </footer>
	)
}

export default Footer
